import React from 'react';

const Brew = ({ playlistId, name, color }) => {
  return (
    <div style={{...styles.brew, backgroundColor: color}}>
      <h1 style={styles.brewTitle}>{name}</h1>
    </div>
  )
}

const styles = {
  brew: {
    borderStyle: 'solid',
    borderWidth: '1px',
    width: '144px',
    height: '144px',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    margin: '16px',
  },
  brewTitle: {
    fontSize: '16px',
    lineHeight: '19px',
    fontWeight: 400,
    margin: '16px',
    textAlign: 'center',
  },
}

export default Brew
